def add(number1, number2):
    print(number1+number2)

def subtract(number1, number2):
    print(number1-number2)

def multiply(number1, number2):
    print(number1*number2)

def divide(number1, number2):
    print(number1/number2)

def square(number):
    print (number*number)

def cube(number):
    print (number*number*number)
